import React from 'react';

import './App.css';

import Navigation from './components/Navigation';
import Introduction from './components/Introduction';
import Portfolio from './components/Portfolio';
import Footer from './components/Footer';

class App extends React.Component {
  state = {
    title: 'Noah Jung',
    headerLinks: [
      { title: 'Home', path: '/' },
      { title: 'Project', path: '/project' },
      { title: 'Contact', path: '/contact' }
    ],
    home: {
      title: 'Hi, my name is Noah.',
      text: `I am a UX/UI Designer interested in leveraging technology to make people's lives more efficient and happier.
      I have previously worked at Luxrobo, Giant Shoulders, and Weddell Co. to build products from scratch. I am currently looking for new opportunities after studying Industrial Design at Rhode Island School of Design.`
    },
    about: {
      title: 'About Me'
    },
    contact: {
      title: "Let's Talk"
    }
  };

  render() {
    return (
      <div>
        <div>
          <Navigation />
          <Introduction />
          <Portfolio />
          <Footer />
        </div>
      </div>
    );
  }
}

export default App;
